协议限定(associatedtype)
从字面上来理解，就是相关类型。意思也就是被associatedtype关键字修饰的变量，相当于一个占位符，而不能表示具体的类型。具体的类型需要让实现的类来指定。
在实现中的转换很多时候并没有太多的意义，而且将责任扔给了运行时。好的做法是让编译的时候就确定类型，这种情况就可以用associatedtype。
class Data{
    var name:String

    init(name:String) {
        self.name = name
    }
}

protocol Test{
    associatedtype D
    func play(param:D)
}

